import {GET_BRANDS,
        GET_TRADE_PAVILIONS,
        GET_ITEMS,
       SET_CURRENT_TRADE_PAVILIONS} from '../constants/brands'


let initialState = {
    brands: [],
    currentBrand: {},
    items: [],
}

const BrandReducer = (state = initialState, action) => {
    switch (action.type){
        case GET_BRANDS:{
            return { ...state, brands: action.value }
        };
        case GET_TRADE_PAVILIONS:{
            return { ...state, tardePavilions: action.value }
        };
        case GET_ITEMS:{
            return { ...state, items: action.value }
        };
        case SET_CURRENT_TRADE_PAVILIONS:{
            return { ...state, currentBrand: action.value }
        };
        default: {
            return state;
        }
    }
}

export default BrandReducer
